import Login from './components/ClientAuth/Login/Login.js';
import { Switch, BrowserRouter, Route} from 'react-router-dom/cjs/react-router-dom.min';
import Signup from './components/ClientAuth/Register/Signup'
import Dashboard from './components/Dashboard';
import ResetEmail from './components/ClientAuth/pwd/ResetEmail.js';
import pwdReset from './components/ClientAuth/pwd/pwdReset.js';

function App() {
  return (
    <div>
      <BrowserRouter>
        <Switch>
          <Route exact path="/" component={Dashboard} />
          <Route path="/login" component={Login} />
          <Route path="/signup" component={Signup} />
          <Route path="/password/email" component={ResetEmail} />
          <Route path="/password/reset" component={pwdReset} />
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
